description:
In Dutch Classics 3 you find sixteen editions of the engine, eight simple mode and eight expert mode editions, from the classic turquoise colour scheme to the later Berlin blue, modernized yellow/grey scheme and the ACTS blue scheme.

With six standard scenarios you can start driving the engine immediately after installation.



Please support the developers and buy some of their content if you can afford it.


Please use the email address for requests and questions and if you want to share an addon with the community then contact us and we will post it on your behalf. If you would like to contribute, please read the Readme.pdf.


